import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import logo from "../assets/images/logo-black.png";
// console.log(logo);

class Navigation extends Component {
  render() {
    return (
      <div>
        <div className="navigation">
          <NavLink exact="true" to="/" className="nav-home">
            Home
          </NavLink>
          <NavLink exact="true" to="/a-propos" className="nav-about">
            A propos
          </NavLink>
          <img src={logo} alt="Logo" />
          <NavLink exact="true" to="/atelier" className="nav-workshop">
            Mon atelier
          </NavLink>
          <NavLink exact="true" to="/contact" className="nav-contact">
            contact
          </NavLink>
        </div>
      </div>
    );
  }
}

export default Navigation;
